import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';

import 'fontsource-roboto';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

const theme = createMuiTheme();

theme.typography.h1 = {
  fontSize: '1.2rem',
  '@media (min-width:600px)': {
    fontSize: '1.5rem',
  },
  [theme.breakpoints.up('md')]: {
    fontSize: '2.4rem',
  },
};

function Intro() {

  const classes = useStyles();

  return (
    <>
      {/* <Paper className={classes.paper}>Intro</Paper> */}
      <ThemeProvider theme={theme}>
  <Typography variant="h3">Responsive h3</Typography>
</ThemeProvider>
    </>
  )
}

function Profile() {

  const classes = useStyles();

  return (
    <>
      {/* <Paper className={classes.paper}>Profile</Paper> */}
      <Avatar className={classes.paper} alt="Brenden Smith" src="/assets/img/profile.jpg" />
      <Grid container direction="row" justify="center" align="center" spacing={1}>
        <Grid item>
          <Avatar/>
        </Grid>
        <Grid item>
          <Avatar/>
        </Grid>
      </Grid>
    </>
  )
}

function App() {
  const classes = useStyles();

  return (
    <div container className={classes.root}>
      <Grid container spacing={3} align="center" justify="center">
        <Grid item xs={6}>
          <Intro/>
        </Grid>
        <Grid item xs={6} align="center" justify="center">
          <Profile/>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
